import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const Alam = () => {
    return (
        <View style={{flex:'1', backgroundColor:'#000', width:'100px', height}}>
            <Text>   Alam</Text>
        </View>
    );
}

const styles = StyleSheet.create({})

export default Alam;
